import React, { Component } from 'react';

import Head from 'next/head';

class InfoBlocks extends Component {

    render() {
        return (
            <div>
                <Head>
                    <link href="https://fonts.googleapis.com/css?family=Montserrat:300,400,500,600,700&display=swap" rel="stylesheet" />
                    <link href="/static/style.css" rel="stylesheet" />
                </Head>
                <div className="info-blocks">
                    <div className="container">
                        <div className="img">
                            <img src="images/img35.png" alt="Image Description" />
                        </div>
                        <div className="textblock">
                            <div className="holder">
                                <h2>Business Insights</h2>
                                <p>Aesthetic Record’s all-in-one integration allows you to pull 100s of reports that help you make critical business decisions. Whether it’s measuring sales or profit, managing patients, tracking discounts, or controlling inventory levels, the Control Center can do it all.</p>
                                <a href="#" className="more">Learn more</a>
                            </div>
                        </div>
                    </div>
                    
                    
                </div>
            </div>
        );
    }
}

export default InfoBlocks;
